import React from "react";
import CopyrightIcon from '@material-ui/icons/Copyright';
import TwitterIcon from '@material-ui/icons/Twitter';
import FacebookIcon from '@material-ui/icons/Facebook';
import YouTubeIcon from '@material-ui/icons/YouTube';

const Footer = () => {
  return (
    <div className="footer fs100 text-center mt-5">
      <div className="pb-1">
        <div className="d-flex justify-content-center align-center">
          <CopyrightIcon className="copyright-icon" />  
          <div>DailyTohokuShimbun</div>
        </div>
        <div className="d-flex justify-content-center align-center">
          <a class="d-block" href="https://twitter.com/daily_tohoku" target="_blank"><TwitterIcon /></a>
          <a class="d-block" href="https://www.facebook.com/dailytohoku" target="_blank"><FacebookIcon /></a>
          <a class="d-block" href="https://www.youtube.com/user/dailytohoku/featured" target="_blank"><YouTubeIcon /></a>
        </div>
      </div>
    </div>
  );
};

export default Footer;
